import React from 'react'
import './Homepage.css'

const Homepage = () => {
  return (
    <>
      <h1>Stock Portfolio App</h1>
      <a href="http://localhost:3001/login" class="brk-btn">Log In</a>
      <a href="http://localhost:3001/register" class="brk-btn">Register</a>
    </>
  )
}

export default Homepage
